export default (function(a,b,c,d,e,f,g,h,i,j){return {data:{MqsqMaYlVw:{data:{id:1279,attributes:{imdbId:"tt0109920",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYTQ3YmE2ODItZjY2Yy00MTMxLTliOWQtNWVkMGM5YWY0YTYwXkEyXkFqcGdeQXVyNjMwMjk0MTQ@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"5.1\u002F10"},{Source:"Rotten Tomatoes",Value:"10%"},{Source:"Metacritic",Value:"46\u002F100"}],item_lang:{data:{id:1942,attributes:{title:d,plot:"Politics are already strained between English imperialists and the West African government of Kinjanja, when womanizing British diplomat Morgan Leafy (Colin Friels) is caught in bed with Celia (Joanne Whalley-Kilmer), wife of corrupt Kinjanjan Presidential candidate Sam Adekunle (Louis Gossett, Jr.). As punishment, Leafy is forced into bribing an official who has voted down a project that stands to make Adekunle very rich. Leafy thinks he's gotten off easy until he learns the lone holdout is none other than Kinjanja's own brick wall of integrity, Dr. Alex Murray (Sir Sean Connery). Meanwhile, Leafy must also contend with his absurdly stuffy boss Fanshawe (John Lithgow), Fanshawe's lusty wife, Chloe (Dame Diana Rigg), and their luscious, too friendly daughter.",slug:"a-good-man-in-africa"}}},books:{data:[{id:7026,attributes:{title:d,description:e,thumbnail:f,authors:[b],firstBook:true,published:g,publisher:h,subtitle:i}},{id:7027,attributes:{title:d,description:e,thumbnail:f,authors:[b],firstBook:c,published:g,publisher:h,subtitle:i}},{id:7028,attributes:{title:"Bamboo",description:"Throughout his career as a novelist, William Boyd has never stopped writing non-fiction, providing a fascinating counterpoint to the world of his novels. Bamboo gathers together Boyd's writing on literature, art, the movie business, television, people he has met, places he has visited and autobiographical reflections on his African childhood and his years at boarding school. From Pablo Picasso to the allure of the British caff, from Charles Dickens to Catherine Deneuve, from mini-cabs to Brideshead Revisited, this collection proves an engrossing and revealing companion to the work of one of Britain's leading novelists.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Ve_hRMEYt7MC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2012-07-13",publisher:j,subtitle:a}},{id:7029,attributes:{title:"A Good Man In Africa",description:a,thumbnail:a,authors:[b],firstBook:c,published:"2002-01-01",publisher:a,subtitle:a}},{id:7030,attributes:{title:"Waiting for Sunrise",description:"A thrilling, plot-twister set in Europe during the first world war, from the bestselling author of Any Human Heart, Restless and Ordinary Thunderstorms.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=E5G8k0v4snMC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2013-01-01",publisher:j,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940980016}}("","William Boyd",null,"A Good Man in Africa","In the small African republic of Kinjanja, British diplomat Morgan Leafy bumbles heavily through his job. His love of women, his fondness for drink, and his loathing for the country prove formidable obstacles on his road to any kind of success. But when he becomes an operative in Operation Kingpin and is charged with monitoring the front runner in Kinjanjaâ€™s national elections, Morgan senses an opportunity to achieve real professional recognition and, more importantly, reassignment. After he finds himself being blackmailed, diagnosed with a venereal disease, attempting bribery, and confounded with a dead body, Morgan realizes that very little is going according to plan.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=6lzhu0on3w0C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2011-07-06","Vintage","A Novel","A&C Black"))